const METADATA = {
    website: "https://github.com/WaffleDevsAlt/Shapez.io-Mods",
    author: "WaffleDevs",
    name: "1x1 Buildings Mod",
    version: "v1.1r",
    id: "1x1-buildings",
    description: "This mod adds 1x1 variants of buildings!",
    minimumGameVersion: ">=1.5.0",
};

class Mod extends shapez.Mod {
    init() {
    	//1x1 Cutter
        shapez.enumCutterVariants['1x1'] = "1x1";

        this.modInterface.addVariantToExistingBuilding(
            shapez.MetaCutterBuilding,
            shapez.enumCutterVariants['1x1'],
            {
                name: "1x1 Cutter",
                description: "A 1 by 1 version of the cutter",

                tutorialImageBase64: RESOURCES["1x1cutter.png"],
                regularSpriteBase64: RESOURCES["1x1cutter.png"],
                blueprintSpriteBase64: RESOURCES["1x1cutterBlueprint.png"],

                dimensions: new shapez.Vector(1, 1),

                additionalStatistics(root) {
                    const speed = root.hubGoals.getProcessorBaseSpeed(shapez.enumItemProcessorTypes.cutter)
                    return [
                        [
                            shapez.T.ingame.buildingPlacement.infoTexts.speed,
                            shapez.formatItemsPerSecond(speed),
                        ],
                    ];
                },

                isUnlocked(root) {
                    return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_cutter_and_trash);;
                },
            }
        );

        this.modInterface.extendClass(shapez.MetaCutterBuilding, ({ $old }) => ({
            updateVariants(entity, rotationVariant, variant) {
                if (variant === shapez.enumCutterVariants['1x1']) {
                    entity.components.ItemEjector.setSlots([
                        { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left },
                        { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right },
                    ]);
                    entity.components.ItemProcessor.type = shapez.enumItemProcessorTypes.cutter;
                    entity.components.ItemAcceptor.setSlots([
                        {
                            pos: new shapez.Vector(0, 0),
                            direction: shapez.enumDirection.bottom,
                            filter: "shape",
                        },
                    ]);
                } else {
                    $old.updateVariants.bind(this)(entity, rotationVariant, variant);
                }
            },
        }));

        //1x1 Stacker
        const enumStackerVariants = {'1x1': "1x1"}

        this.modInterface.addVariantToExistingBuilding(
            shapez.MetaStackerBuilding,
            enumStackerVariants['1x1'],
            {
                name: "1x1 Stacker",
                description: "A 1 by 1 version of the stacker",

                tutorialImageBase64: RESOURCES["1x1stacker.png"],
                regularSpriteBase64: RESOURCES["1x1stacker.png"],
                blueprintSpriteBase64: RESOURCES["1x1stackerBlueprint.png"],

                dimensions: new shapez.Vector(1, 1),

                additionalStatistics(root) {
                    const speed = root.hubGoals.getProcessorBaseSpeed(shapez.enumItemProcessorTypes.stacker)
                    return [
                        [
                            shapez.T.ingame.buildingPlacement.infoTexts.speed,
                            shapez.formatItemsPerSecond(speed),
                        ],
                    ];
                },

                isUnlocked(root) {
                    return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_stacker);;
                },
            }
        );

        this.modInterface.extendClass(shapez.MetaStackerBuilding, ({ $old }) => ({
            updateVariants(entity, rotationVariant, variant) {
                if (variant === enumStackerVariants['1x1']) {
                    entity.components.ItemEjector.setSlots([
                        { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                    ]);
                    entity.components.ItemProcessor.type = shapez.enumItemProcessorTypes.stacker;
                    entity.components.ItemAcceptor.setSlots([
                        {
                            pos: new shapez.Vector(0, 0),
                            direction: shapez.enumDirection.left,
                            filter: "shape",
                        },
                        {
                            pos: new shapez.Vector(0, 0),
                            direction: shapez.enumDirection.right,
                            filter: "shape",
                        },
                    ]);
                } else {
                    entity.components.ItemEjector.setSlots([
                        { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                    ]);
                    entity.components.ItemProcessor.type = shapez.enumItemProcessorTypes.stacker;
                    entity.components.ItemAcceptor.setSlots([
                        {
                            pos: new shapez.Vector(0, 0),
                            direction: shapez.enumDirection.bottom,
                            filter: "shape",
                        },
                        {
                            pos: new shapez.Vector(1, 0),
                            direction: shapez.enumDirection.bottom,
                            filter: "shape",
                        },
                    ]);
                    $old.updateVariants.bind(this)(entity, rotationVariant, variant);
                }
            },
        }));

        //1x1 Mixer
        const enumMixerVariants = {'1x1': "1x1"}

        this.modInterface.addVariantToExistingBuilding(
            shapez.MetaMixerBuilding,
            enumMixerVariants['1x1'],
            {
                name: "1x1 Mixer",
                description: "A 1 by 1 version of the mixer",

                tutorialImageBase64: RESOURCES["1x1mixer.png"],
                regularSpriteBase64: RESOURCES["1x1mixer.png"],
                blueprintSpriteBase64: RESOURCES["1x1mixerBlueprint.png"],

                dimensions: new shapez.Vector(1, 1),

                additionalStatistics(root) {
                    const speed = root.hubGoals.getProcessorBaseSpeed(shapez.enumItemProcessorTypes.mixer)
                    return [
                        [
                            shapez.T.ingame.buildingPlacement.infoTexts.speed,
                            shapez.formatItemsPerSecond(speed),
                        ],
                    ];
                },

                isUnlocked(root) {
                    return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_mixer);;
                },
            }
        );

        this.modInterface.extendClass(shapez.MetaMixerBuilding, ({ $old }) => ({
            updateVariants(entity, rotationVariant, variant) {
                if (variant === enumMixerVariants['1x1']) {
                    entity.components.ItemEjector.setSlots([
                        { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                    ]);
                    entity.components.ItemProcessor.type = shapez.enumItemProcessorTypes.mixer;
                    entity.components.ItemAcceptor.setSlots([
                        {
                            pos: new shapez.Vector(0, 0),
                            direction: shapez.enumDirection.left,
                            filter: "color",
                        },
                        {
                            pos: new shapez.Vector(0, 0),
                            direction: shapez.enumDirection.right,
                            filter: "color",
                        },
                    ]);
                } else {
                    entity.components.ItemEjector.setSlots([
                        { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
                    ]);
                    entity.components.ItemProcessor.type = shapez.enumItemProcessorTypes.mixer;
                    entity.components.ItemAcceptor.setSlots([
                        {
                            pos: new shapez.Vector(0, 0),
                            direction: shapez.enumDirection.bottom,
                            filter: "color",
                        },
                        {
                            pos: new shapez.Vector(1, 0),
                            direction: shapez.enumDirection.bottom,
                            filter: "color",
                        },
                    ]);
                    $old.updateVariants.bind(this)(entity, rotationVariant, variant);
                }
            },
        }));

        //1x1 Storage
        const enumStorageVariants = {'1x1': "1x1"}
        const storageSize = 1000;
        this.modInterface.addVariantToExistingBuilding(
            shapez.MetaStorageBuilding,
            enumStorageVariants['1x1'],
            {
                name: "1x1 Storage",
                description: "A 1 by 1 version of the storage",

                tutorialImageBase64: RESOURCES["1x1storage.png"],
                regularSpriteBase64: RESOURCES["1x1storage.png"],
                blueprintSpriteBase64: RESOURCES["1x1storageBlueprint.png"],

                dimensions: new shapez.Vector(1, 1),

                additionalStatistics(root) {
                    return [[shapez.T.ingame.buildingPlacement.infoTexts.storage, shapez.formatBigNumber(storageSize)]];
                },

                isUnlocked(root) {
                    return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_storage);;
                },
            }
        );

        this.modInterface.extendClass(shapez.MetaStorageBuilding, ({ $old }) => ({
            updateVariants(entity, rotationVariant, variant) {
                if (variant === enumStorageVariants['1x1']) {
                    entity.addComponent(
			            new shapez.ItemEjectorComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.top,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(
			            new shapez.ItemAcceptorComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.bottom,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(
			            new shapez.StorageComponent({
			                maximumStorage: storageSize,
			            })
			        );

			        entity.addComponent(
			            new shapez.WiredPinsComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.right,
			                        type: shapez.enumPinSlotType.logicalEjector,
			                    },
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.left,
			                        type: shapez.enumPinSlotType.logicalEjector,
			                    },
			                ],
			            })
	        		);
                } else {
                    entity.addComponent(
			            new shapez.ItemEjectorComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.top,
			                    },
			                    {
			                        pos: new shapez.Vector(1, 0),
			                        direction: shapez.enumDirection.top,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(
			            new shapez.ItemAcceptorComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 1),
			                        direction: shapez.enumDirection.bottom,
			                    },
			                    {
			                        pos: new shapez.Vector(1, 1),
			                        direction: shapez.enumDirection.bottom,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(
			            new shapez.StorageComponent({
			                maximumStorage: 5000,
			            })
			        );

			        entity.addComponent(
			            new shapez.WiredPinsComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(1, 1),
			                        direction: shapez.enumDirection.right,
			                        type: shapez.enumPinSlotType.logicalEjector,
			                    },
			                    {
			                        pos: new shapez.Vector(0, 1),
			                        direction: shapez.enumDirection.left,
			                        type: shapez.enumPinSlotType.logicalEjector,
			                    },
			                ],
			            })
			        );
                    $old.updateVariants.bind(this)(entity, rotationVariant, variant);
                }
            },
        }));

        //1x1 Filter
        const enumFilterVariants = {'1x1': "1x1"}

        this.modInterface.addVariantToExistingBuilding(
            shapez.MetaFilterBuilding,
            enumFilterVariants['1x1'],
            {
                name: "1x1 Filter",
                description: "A 1 by 1 version of the filter",

                tutorialImageBase64: RESOURCES["1x1filter.png"],
                regularSpriteBase64: RESOURCES["1x1filter.png"],
                blueprintSpriteBase64: RESOURCES["1x1filterBlueprint.png"],

                dimensions: new shapez.Vector(1, 1),

                additionalStatistics(root) {
                    const beltSpeed = root.hubGoals.getBeltBaseSpeed();
        			return [[shapez.T.ingame.buildingPlacement.infoTexts.speed, shapez.formatItemsPerSecond(beltSpeed)]];
                },

                isUnlocked(root) {
                    return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_filter);
                },
            }
        );


        this.modInterface.extendClass(shapez.MetaFilterBuilding, ({ $old }) => ({
            updateVariants(entity, rotationVariant, variant) {
                if (variant === enumFilterVariants['1x1']) {
                    entity.addComponent(
			            new shapez.WiredPinsComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.left,
			                        type: shapez.enumPinSlotType.logicalAcceptor,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(
			            new shapez.ItemAcceptorComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.bottom,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(
			            new shapez.ItemEjectorComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.top,
			                    },
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.right,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(new shapez.FilterComponent());
                } else {
                    entity.addComponent(
			            new shapez.WiredPinsComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.left,
			                        type: shapez.enumPinSlotType.logicalAcceptor,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(
			            new shapez.ItemAcceptorComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.bottom,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(
			            new shapez.ItemEjectorComponent({
			                slots: [
			                    {
			                        pos: new shapez.Vector(0, 0),
			                        direction: shapez.enumDirection.top,
			                    },
			                    {
			                        pos: new shapez.Vector(1, 0),
			                        direction: shapez.enumDirection.right,
			                    },
			                ],
			            })
			        );

			        entity.addComponent(new shapez.FilterComponent());
                    $old.updateVariants.bind(this)(entity, rotationVariant, variant);
                }
            },
        }));

        //1x1 Painter
        shapez.enumPainterVariants['1x1'] = "1x1"

        this.modInterface.addVariantToExistingBuilding(
            shapez.MetaPainterBuilding,
            shapez.enumPainterVariants['1x1'],
            {
                name: "1x1 Painter",
                description: "A 1 by 1 version of the painter",

                tutorialImageBase64: RESOURCES["1x1painter.png"],
                regularSpriteBase64: RESOURCES["1x1painter.png"],
                blueprintSpriteBase64: RESOURCES["1x1painterBlueprint.png"],

                dimensions: new shapez.Vector(1, 1),

                additionalStatistics(root) {
                    const beltSpeed = root.hubGoals.getBeltBaseSpeed();
        			return [[shapez.T.ingame.buildingPlacement.infoTexts.speed, shapez.formatItemsPerSecond(beltSpeed)]];
                },

                isUnlocked(root) {
                    return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_painter);
                },
            }
        );


        this.modInterface.extendClass(shapez.MetaPainterBuilding, ({ $old }) => ({
            updateVariants(entity, rotationVariant, variant) {
                if (variant === shapez.enumPainterVariants['1x1']) {
                    if (entity.components.WiredPins) {
	                    entity.removeComponent(shapez.WiredPinsComponent);
	                }

	                entity.components.ItemAcceptor.setSlots([
	                    {
	                        pos: new shapez.Vector(0, 0),
	                        direction: shapez.enumDirection.left,
	                        filter: "shape",
	                    },
	                    {
	                        pos: new shapez.Vector(0, 0),
	                        direction: shapez.enumDirection.top,
	                        filter: "color",
	                    },
	                ]);

	                entity.components.ItemEjector.setSlots([
	                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.right },
	                ]);

	                entity.components.ItemProcessor.type = shapez.enumItemProcessorTypes.painter;
	                entity.components.ItemProcessor.processingRequirement = null;
	                entity.components.ItemProcessor.inputsPerCharge = 2;
                } else {
                   
                    $old.updateVariants.bind(this)(entity, rotationVariant, variant);
                }
            },
        }));
    }
};

const RESOURCES = {
	"1x1stacker.png": 
        "data:image/png;base64,",
    "1x1stackerBlueprint.png": 
        "data:image/png;base64,",
	"1x1mixer.png": 
        "data:image/png;base64,",
    "1x1mixerBlueprint.png": 
        "data:image/png;base64,",
    "1x1storage.png":
        "data:image/png;base64,",
   "1x1storageBlueprint.png":
        "data:image/png;base64,",
	"1x1cutter.png":
		"data:image/png;base64,",
    "1x1cutterBlueprint.png":
		"data:image/png;base64,",
	"1x1filter.png":
        "data:image/png;base64,",
    "1x1filterBlueprint.png":
        "data:image/png;base64,",
	"1x1painter.png":
        "data:image/png;base64,",
    "1x1painterBlueprint.png":
        "data:image/png;base64,",

};